script: |
  super -f text -I q3505.spq | sort > q3505.out

inputs:
  - name: q3505.spq
    data: |
      SELECT tab1.col2 AS col0 FROM tab1 (FORMAT parquet) WHERE - col1 NOT BETWEEN ( col0 / + col0 + - col0 * + col2 / - col2 ) AND ( - col0 + col0 / col1 );
  - name: tab1

outputs:
  - name: q3505.out
    data: |
      54
      57
      96
